import React, { useState, useEffect } from 'react';
import styles from './SuperAdminReports.module.css';
import axios from 'axios';

const SuperAdminReports = () => {
  const [requests, setRequests] = useState([]);
  const [showDelayed, setShowDelayed] = useState(false);
  const [totalResidents, setTotalResidents] = useState(0);

  useEffect(() => {
    axios.get('http://localhost:8080/requests')
      .then(response => setRequests(response.data))
      .catch(error => console.error('Error fetching requests:', error));

    axios.get('http://localhost:8080/users/count')
      .then(response => setTotalResidents(response.data))
      .catch(error => console.error('Error fetching resident count:', error));
  }, []);

  const totalRequests = requests.length;
  const completedRequests = requests.filter(req => req.status === 'Completed').length;
  const pendingRequests = requests.filter(req => req.status === 'Pending').length;
  const delayedRequests = requests.filter(req => 
    req.status === 'Pending' && new Date(req.exceptCompletionDate) < new Date()
  );

  return (
    <div className={styles.container}>
      <h2>Super Admin Reports</h2>
      <div className={styles.summaryCards}>
        <div className={styles.card}>
          <h4>Total Requests</h4>
          <p>{totalRequests}</p>
        </div>
        <div className={styles.card}>
          <h4>Completed</h4>
          <p>{completedRequests}</p>
        </div>
        <div className={styles.card}>
          <h4>Pending</h4>
          <p>{pendingRequests}</p>
        </div>
      </div>
      <div className={styles.delayedSection}>
        <h3>Delayed Requests</h3>
        <button className={styles.toggleButton} onClick={() => setShowDelayed(!showDelayed)}>
          {showDelayed ? 'Hide Delayed Requests' : 'Show Delayed Requests'}
        </button>
        {showDelayed && (
          <table className={styles.table}>
            <thead>
              <tr>
                <th>ID</th>
                <th>Service ID</th>
                <th>User ID</th>
                <th>Status</th>
              </tr>
            </thead>
            <tbody>
              {delayedRequests.map(req => (
                <tr key={req.requestId}>
                  <td>{req.requestId}</td>
                  <td>{req.serviceId}</td>
                  <td>{req.userId}</td>
                  <td>{req.status}</td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
      <div className={styles.residentCount}>
        <h3>Total Registered Residents</h3>
        <p>{totalResidents}</p>
      </div>
    </div>
  );
};

export default SuperAdminReports;
